== 简介 ==
活动后半战收录乐曲，曲目作者为VENUS([[DJ YOSHITAKA]]&Sota Fujimori) feat. <BR>[[泉陆奥彦|Mutsuhiko Izumi]]（即三人合作），所以曲目封面也为<s>3P</s>3人。90年代偶像组合风的VENUS曲中'''第一首没有VOCAL的歌曲'''<s>想象一下演唱会一首歌通篇没歌词</s>。

歌曲的分类方面，popn系列沿用了VENUS曲分类"WITHOUT YOU TONIGHT"，并在之后标记罗马数字6作为第六曲。而IIDX系列同样也使用了类似的标题"WITHOUT YOU NIGHT -IV-"而非之前移植VENUS曲使用正规曲分类。但IIDX的分类拼法有些许不同。

曲目中使用了Wow  Wow VENUS和Brand New World的素材，两者皆为VENUS的歌曲。

